p_01.applyStepsToNormalizedParameterValue:
function applyStepsToNormalizedParameterValue(normalizedValue, steps) {
    if (steps == 1) {
        if (normalizedValue > 0) {
            normalizedValue = 1.;
        }
    } else {
        let oneStep = 1. / (steps - 1);
        let numberOfSteps = rnbo_fround(normalizedValue / oneStep * 1 / 1) * 1;
        normalizedValue = numberOfSteps * oneStep;
    }

    return normalizedValue;
}

p_01.convertToNormalizedParameterValue:
function convertToNormalizedParameterValue(index, value) {
    switch (index) {
    case 0:
        {
            value = (value < 10 ? 10 : (value > 1000 ? 1000 : value));
            let normalizedValue = (value - 10) / (1000 - 10);
            return normalizedValue;
        }
    case 1:
        {
            value = (value < -60 ? -60 : (value > 0 ? 0 : value));
            let normalizedValue = (value - -60) / (0 - -60);
            return normalizedValue;
        }
    default:
        return value;
    }
}

p_01.convertFromNormalizedParameterValue:
function convertFromNormalizedParameterValue(index, value) {
    value = (value < 0 ? 0 : (value > 1 ? 1 : value));

    switch (index) {
    case 0:
        {
            {
                return 10 + value * (1000 - 10);
            }
        }
    case 1:
        {
            {
                return -60 + value * (0 - -60);
            }
        }
    default:
        return value;
    }
}

p_01.constrainParameterValue:
function constrainParameterValue(index, value) {
    var v = value;

    switch (index) {
    case 0:
        {
            v = (v > 1000 ? 1000 : (v < 10 ? 10 : v));
            return v;
        }
    case 1:
        {
            v = (v > 0 ? 0 : (v < -60 ? -60 : v));
            return v;
        }
    default:
        return value;
    }
}
